import React from "react";
import './content.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCircleDollar } from '@fortawesome/free-solid-svg-icons';
import { faFaceSmile } from '@fortawesome/free-regular-svg-icons'; // Import the smile icon

function Content() {
    return (
        <div className="content">
            <div>
                <p><FontAwesomeIcon icon={faFaceSmile} />  
                
                <FontAwesomeIcon icon={faCircleDollar} /></p>
            </div>
        </div>
    );
}

export default Content;
